import React from 'react';//importação do react
import { Link } from 'react-router-dom';//resposanvel pelos links entre as paginas

//importação de icones para o componente
import logoImg from '../../assets/images/icons/logo.svg';//icone de logo da aplicação
import backImg from '../../assets/images/icons/back.svg';//icone para voltar a pagiina inicial

//importação do arquivo de estilização da pagina
import './styles.css';

export default function TeactherList(){
  return(
    <div id="page-teacther-list" className="container">
      <header className="page-header">
        <div className="top-bar-container">
          <Link to="/">
            <img src={backImg} alt="Voltar"/>
          </Link>
           <img src={logoImg} alt="Proffy logo"/>
        </div>

      <div className="header-content">
        <strong>Estes são os proffys disponiveis.</strong>  
      </div>   
      </header>
    </div>
  );
}
